const home = {
	greeting: `What's good 👋🏼`,
	bio: [
		`I’m Jackson Taylor, a computer science student studying at the University of Florida who loves building freelance applications for clients and personal projects. Currently, I'm interested in the impact of software in sectors slow to adopt new technologies.`,
		`When I’m not studying or writing code, I enjoy learning about technology in the developing world 🌍, brewing chemex coffee ☕️, and practicing meditation 🧘.`,
	],
};

export default home;
